import React from "react";

const Navbar: React.FC = () => {
  return (
    <React.Fragment>
      <nav>
        <div className="nav-top-line" />
        <div className="nav-container">
          <h1 className="nav-site-name">AskProgramming</h1>
          <button className="nav-auth-btn">Sign Up</button>
          <button className="nav-auth-btn">Log In</button>
        </div>
      </nav>

      <style jsx>{`
        .nav-top-line {
          width: 100%;
          height: 4px;
          background: #c46215;
        }

        .nav-container {
          background: #36393c;
          width: 100%;
          height: 40px;
          display: flex;
          align-items: center;
          justify-content: space-between;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Navbar;
